To achieve this, you can use a combination of `useEffect` and `setTimeout`. Here's an example of how you can modify your code:

```jsx
import React, { useRef, useEffect } from 'react';
import gsap from 'gsap';

const Portfolio = () => {
  const cursor = useRef({ cursorImage: '' }); // assuming cursor is an object with a property 'cursorImage'
  const portfolioCurrent = useRef(null);
  const portfolioNext = useRef(null);

  useEffect(() => {
    if (portfolioCurrent.current && portfolioNext.current) {
      const animate = () => {
        gsap.to(portfolioCurrent.current, {
          clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
          duration: .5,
        });

        gsap.to(portfolioNext.current, {
          clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
          delay: .1,
          duration: .5,
        });

        gsap.set(portfolioCurrent.current, {
          clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        });

