        gsap.set(portfolioNext.current, {
          css: { backgroundImage: `url(${cursor.current.cursorImage})` },
        });
      };

      animate();
      const timeout = setTimeout(animate, 600); // run the animation every 600ms (.6 seconds)

      // clear the timeout when the component unmounts or the cursorImage changes
      return () => clearTimeout(timeout);
    }
  }, [cursor.current.cursorImage]);

