  );
};

export default Portfolio;
```

In this example, the animation is run once when the component mounts, and then every 600ms (.6 seconds) after that, as long as the component is still mounted. The timeout is cleared when the component unmounts or the `cursorImage` changes, ensuring that the animation doesn't run unnecessarily.

