```javascript
function packEntities(entities) {
  const buffer = new Uint16Array(Math.ceil(entities.length / 2));

  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;

    // Pack id (4 bits) and size (3 bits) into a single 16-bit value
    const packed = (id << 3) | size;
    buffer[offset] = packed;

    // Move to the next 16-bit position
    offset += 1;
  }

  return buffer.buffer;
}

function unpackEntities(buffer, length) {
  const entities = [];
  let offset = 0;

  for (let i = 0; i < length; i += 2) {
    const packed = new Uint16Array(buffer, i, 1)[0];

    // Extract id (4 bits) and size (3 bits) from the packed value
    const id = packed >> 3;
    const size = packed & 7;

    entities.push({ id, size });

    // Move to the next 16-bit position
    offset += 2;
  }

  return entities;
}
```

In the `packEntities` function, we create a Uint16Array buffer and pack the entities into it using bitwise operations. The id and size are combined into a single 16-bit value, and each pair of entities is stored in a single 16-bit position of the buffer.

In the `unpackEntities` function, we create an array to store the unpacked entities. We extract the id and size from each packed value using bitwise operations and push the resulting entity object into the array. The unpacked entities are stored in pairs in the buffer, so we move to the next 16-bit position after unpacking each pair.

